        $this->addSql("INSERT INTO drawback (id, name, effect, min_roll, max_roll) VALUES (1, 'Black Cataract', 'Effect: Whenever you miss with Attack Actions using a ranged weapon, you must re-roll the result with the same Difficulty Rating. If it is a success, you strike a random ally who is Engaged with your target.', 1, 8);");
        $this->addSql("INSERT INTO drawback (id, name, effect, min_roll, max_roll) VALUES (2, 'Branded', 'Effect: Whenever you interact with those who know you’re Branded and hold you in contempt due to it, you cannot succeed at Fellowship-based Skill Tests to interact with them.', 9, 16);");
        $this->addSql("INSERT INTO drawback (id, name, effect, min_roll, max_roll) VALUES (3, 'Crop Ear', 'Effect: You must flip the results to fail all Skill Tests that rely on hearing.', 17, 25);");
        $this->addSql("INSERT INTO drawback (id, name, effect, min_roll, max_roll) VALUES (4, 'Cursed', 'Effect: Whenever you intend to sacrifice a Fortune Point, roll a 1D6 Chaos Die. If the result is a face ‘6’, you must use two Fortune Points instead of one.', 26, 33);");
        $this->addSql("INSERT INTO drawback (id, name, effect, min_roll, max_roll) VALUES (5, 'Debt-Ridden', 'Effect: You must flip the results to fail all Skill Tests that rely on your ability to barter, bargain or strike monetary deals in your favor.', 34, 41);");
        $this->addSql("INSERT INTO drawback (id, name, effect, min_roll, max_roll) VALUES (6, 'Dunderhead', 'Effect: Whenever you suffer mental Peril, move one additional step down the Peril Condition Track negatively while suffering 1 Corruption.', 42, 49);");
        $this->addSql("INSERT INTO drawback (id, name, effect, min_roll, max_roll) VALUES (7, 'Eunuch', 'Effect: You are immune to the charms and seduction by those who find you attractive, and unable to have children. However, being made victim to these same charms and seduction causes you to suffer 1 Corruption.', 50, 58);");
        $this->addSql("INSERT INTO drawback (id, name, effect, min_roll, max_roll) VALUES (8, 'Nemesis', 'Effect: When confronted by your Nemesis, you cannot sacrifice Fate or Fortune Points, as their presence confounds you. Your Nemesis is determined by the GM, who will likely take your ideas about your Character’s history or past rivals into consideration.', 59, 67);");
        $this->addSql("INSERT INTO drawback (id, name, effect, min_roll, max_roll) VALUES (9, 'Veteran’s Boot', 'Effect: You cannot Charge, Maneuver or Run with Movement Actions without spending an additional Action Point.', 68, 76);");
        $this->addSql("INSERT INTO drawback (id, name, effect, min_roll, max_roll) VALUES (10, 'Veteran’s Hand', 'Effect: You cannot hold weapons which are two-handed and must flip the results to fail any Skill Test requiring use of both hands.', 77, 85);");
